import '../../data/models/loan_data_dto.dart';class LoanData {  LoanData({    this.id,    this.freelanceName,    this.freelanceIcon,    this.mobile,    this.idNumber,    this.loanType,    this.loanValue,    this.deductPercentage,    this.remainingLoan,  });  int? id;  String? freelanceName;  String? freelanceIcon;  String? mobile;  String? idNumber;  String? loanType;  double? loanValue;  String? deductPercentage;  double? remainingLoan;  factory LoanData.fromDto(LoanDataDto json) {    return LoanData(      id: json.id,      freelanceName: json.freelanceName,      freelanceIcon: json.freelanceIcon,      mobile: json.mobile,      idNumber: json.idNumber,      loanType: json.loanType,      loanValue: json.loanValue,      deductPercentage: json.deductPercentage,      remainingLoan: json.remainingLoan,    );  }}